            "Desc": "4级合成材料。",
            "Story": "拜三颗卫星所赐，阿丽万塔星球的引力以波德函数的形式时刻发生变化。寻常生命几乎无法在这颗星球生存，因此它最终发展出了阿丽万塔特色的生态系统。其中最有名的是一种可以入药的植物，叫换境树。<br>换境树的落叶期总是来得很晚，因为对引力时常变化的世界来说，叶子如何平稳地落在古老、踏实的地面是头等艰难之事。为了顺利达成这一目标，换境树演化出了极其细微的空间翘曲能力：每当换境树叶飘飘下落，它就会以凡人肉眼无法观测的频率，反复向着地面进行距离极短的跃迁。即使如此，也不是每一片换境树叶都能成功着陆。那些顺利落地的叶子放松地贴住磐石大地，望着同伴飞向高空，并在大气层中燃烧成跃迁的灰。<br><br><i>「哇。」</i>",
